import React, { Component } from "react";
import { Link } from "react-router-dom";

import "../assets/component.css";

class NavBar extends Component {
	render() {
		return (
			<nav className="navbar navbar-success main-color no-underline">
				<Link to="/" className="my-0 mr-md-auto font-weight-bold main-font h4">
					Static
				</Link>
				<a className="p-2 text-dark font-weight-bold" href="#">
					Leaderboard
				</a>
				<a className="p-2 text-dark font-weight-bold" href="#">
					Achievements
				</a>
				<a className="p-2 text-dark font-weight-bold" href="#">
					Settings
				</a>
				<a className="btn btn-warning font-weight-bold" href="#">
					Log out
				</a>
			</nav>
		);
	}
}

export default NavBar;
